#!/bin/bash
python3 - "$@" <<'PY'
import sys, base64, json
if len(sys.argv)!=4:
    print(0)
    sys.exit(0)
try:
    d=float(sys.argv[1]); m=float(sys.argv[2]); r=float(sys.argv[3])
except Exception:
    print(0)
    sys.exit(0)
b64=""
model=json.loads(base64.b64decode(b64))
cl=model['children_left']; cr=model['children_right']; feat=model['feature']; th=model['threshold']; val=model['value']

def predict(d,m,r):
    node=0
    while True:
        if cl[node]==-1:
            return val[node]
        if (d,m,r)[feat[node]] <= th[node]:
            node=cl[node]
        else:
            node=cr[node]

print(f"{predict(d,m,r):.2f}")
PY
